const ImageGridListStyle = {
	root: {
		display: 'flex',
		flexWrap: 'wrap',
		justifyContent: 'space-around',
		overflow: 'hidden',
		backgroundColor: "#fff",
	},
	gridList: {
		'& li': {
			width: "66.6667% !important",
			height: "auto !important",
			padding: "-2px"
		}
	},
};

export default ImageGridListStyle;
